import React from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";
import { Facebook, Twitter, Instagram } from "react-feather";

function Navbar(props) {
  let { home, login, sign, social } = props;

  return (
    <div className="navbar-container">
      <div className="navbar-left-items">
        <Link to="/">
          <img className="logo-img" src="./images/logo-img.png" />
        </Link>
      </div>
      <div className="navbar-right-items">
        <div className="navbar-buttons">
          {login && (
            <div className="navbar-btn  btn-login">
              <Link className="navbar-link-item" to="/login">
                Giriş
              </Link>
            </div>
          )}
          {sign && (
            <div className="navbar-btn  btn-navbar-sign">
              <Link className="navbar-link-item" to="/sign">
                Kayıt
              </Link>
            </div>
          )}
          {social && (
            <div className="social-container">
              <Facebook className="icon-social" color="white" />
              <Twitter className="icon-social" color="white" />
              <Instagram className="icon-social" color="white" />
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default Navbar;
